INSERT INTO `wp_posts` VALUES("79", "1", "2014-02-02 08:15:26", "2014-02-02 08:15:26", "Lazy-loading option preloads nearby items. It accepts array with two integers, first one - is a number of items to preload before the current, second one - the number of images to preload after the current. For example<code>preload: [1,3]</code> will load 3 next items and 1 that is before current. These values are automatically switched based on direction of movement.\r\n\r\nBy default all what it does is just searches for an image tag and preloads it with JavaScript. But you can extend it and do your custom preloading logic with help of <code>lazyLoad</code> event, like so:", "Template Project", "", "publish", "open", "closed", "", "template-project", "", "", "2014-12-27 03:27:22", "2014-12-27 03:27:22", "", "0", "http://demo.themeum.com/starter/?post_type=project&#038;p=79", "4", "project", "", "0");
