INSERT INTO `wp_posts` VALUES("187", "1", "2014-02-12 12:08:57", "2014-02-12 12:08:57", "Nuestra rama de comunicaciones orfece venta, instalación, capacitación y servicio de equipos de telecomunicaciones de voz, datos y videoconferencias, así como a equipo de cómputo. También contamos con diseño e implementaión de redes de fibra óptica y cableado estrcturado UTP.\r\n\r\n<!-- [themeum_project_slider title=\"Our Work\"]-->\r\n[nimble-portfolio post_type=\"project\" taxonomy=\"project_tag\" skin=\"default\" orderby=\"menu_order\" order=\"ASC\" ]\r\n&nbsp;\r\n<div class=\"title-area\">\r\n<p class=\"subtitle\">Telesinergia Seguridad.</p>\r\n\r\n</div>\r\nNuestra rama de seguridad y prevención ofrece venta, instalación, capacitación y servicio de equipos de alertamiento sísmico, circuito cerrado de televisión (CCTv) e interfonos.\r\n\r\n&nbsp;\r\n\r\n[nimble-portfolio post_type=\"portfolio\" taxonomy=\"nimble-portfolio-type\" skin=\"default\" orderby=\"menu_order\" order=\"ASC\" ]", "Portfolio", "", "publish", "open", "open", "", "portfolio", "", "", "2014-12-27 05:09:24", "2014-12-27 05:09:24", "", "0", "http://demo.themeum.com/starter/?page_id=187", "0", "page", "", "0");
