INSERT INTO `wp_posts` VALUES("337", "1", "2014-12-23 01:54:55", "2014-12-23 01:54:55", "[feature icon=\"star-o\" title=\"Historia\" color=\"1\"]\n<p style=\"text-align: justify;\">Telesinergia nace bajo la dirección del Ing. Enrique Muñoz en el año de 1995, siendo su consolidación sino hasta el año 2000. Con el apoyo de Ericsson como distribuidor autorizado, Telesinergia ha logrado posicionarse como una empresa confiable y especializada.</p>\n<p style=\"text-align: justify;\">Es así como mas de 15 años de experiencia nos respaldan como integradores de tecnología a través de soluciones de convergencia global en el marco de las telecomunicaciones, informática y seguridad, desarrollando proyectos integrales de voz, datos, imagen, movilidad y energía.</p>\n\n[/feature]\n\n[feature icon=\"bolt\" title=\"Misión\" color=\"2\"]\n\n<p style=\"text-align: justify;\">En Telesinergia sabemos que la tecnología es cambiante, por lo que nuestra misión es ser una empresa siempre a la vanguardia  tecnológica que ofrece soluciones integrales y especializadas en telecomunicaciones, informática y seguridad. Siendo nuestra principal fortaleza nuestro conocimiento y el compromiso con nuestros clientes, personal y proveedores.</p>\n\n[/feature]\n\n[feature icon=\"gift\" title=\"Visión\" color=\"3\"]\n\nSer una empresa que siga cultivando los mejores niveles de conocimiento con nuestro personal apoyándonos de nuestros proveedores para seguir ofreciendo soluciones integrales en telecomunicaciones de vanguardia a nuestros clientes.\n\n[/feature]\n\n[feature icon=\"code\" title=\"Valores color=\"4\"]\n<ul>\n	<li>Compromiso</li>\n	<li>Honestidad</li>\n	<li>Responsabilidad</li>\n	<li>Respeto</li>\n	<li>Innovación</li>\n</ul>\n[/feature]\n\n[feature icon=\"signal\" title=\"SEO Friendly\" color=\"5\"]\n\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor insed do eiusmod\n\n[/feature]\n\n[feature icon=\"tablet\" title=\"Responsive Themes\" color=\"8\"]\n\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor insed do eiusmod\n\n[/feature]", "Company", "", "inherit", "open", "open", "", "148-autosave-v1", "", "", "2014-12-23 01:54:55", "2014-12-23 01:54:55", "", "148", "http://localhost/telesinenergia/?p=337", "0", "revision", "", "0");
